css:
.editor-colors {
  background-color: #282828;
  color: #f8f8f2;
}
.editor .invisible-character {
  color: rgba(197, 200, 198, 0.2);
}
.editor .indent-guide {
  color: rgba(255, 255, 255, 0.15);
}
.editor .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
.editor .gutter {
  background-color: #303030;
}
.editor .gutter .cursor-line {
  background-color: #49483e;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #49483e;
}
.editor .invisible {
  color: #f8f8f2;
}
.editor .cursor {
  border-color: #f8f8f0;
}
.editor .selection .region {
  background-color: #49483e;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #888888;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.editor .gfm .markup.heading {
  color: #A6E22E;
  font-weight: bold;
}
.editor .gfm .markup.underline {
  color: #E6DB74;
  text-decoration: underline;
}
.editor .gfm .bold {
  font-weight: bold;
}
.editor .gfm .italic {
  font-style: italic;
}
.editor .gfm .raw {
  color: #66D9EF;
}
.editor .gfm .variable.list {
  color: #F92672;
  font-weight: bold;
}
.editor .gfm .link {
  color: #CCC;
}
.editor .gfm .link .entity {
  color: #AE81FF;
}
.comment {
  color: #75715E;
}
.string {
  color: #E6DB74;
}
.constant.numeric {
  color: #AE81FF;
}
.constant.language {
  color: #AE81FF;
}
.constant.character,
.constant.other {
  color: #AE81FF;
}
.keyword {
  color: #F92672;
}
.storage {
  color: #F92672;
}
.storage.type {
  font-style: italic;
  color: #66D9EF;
}
.entity.name.class {
  text-decoration: underline;
  color: #A6E22E;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #A6E22E;
}
.entity.name.function {
  color: #A6E22E;
}
.entity.name.instance {
  color: #66D9EF;
}
.variable.parameter {
  font-style: italic;
  color: #FD971F;
}
.entity.name.tag {
  color: #F92672;
}
.entity.other.attribute-name {
  color: #A6E22E;
}
.support.function {
  color: #66D9EF;
}
.support.constant {
  color: #66D9EF;
}
.support.type,
.support.class {
  font-style: italic;
  color: #66D9EF;
}
.invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
.class.jade {
  color: #AE81FF;
}
.php.punctuation.section.embedded.begin,
.php.punctuation.section.embedded.end {
  color: #ae81ff;
  font-weight: bold;
}
.php.support.function.construct {
  color: #b294bb;
  font-weight: bold;
}
.php.meta.function-call {
  color: #a6e22e;
}
.php.keyword {
  color: #66d9ef;
  font-weight: bold;
}
.php.keyword.operator {
  color: #f92672;
  font-weight: normal;
}
.php.keyword.control {
  color: #66d9ef;
  font-weight: bold;
}
